import "./Footer.css";
class Footer extends Component {
  render() {
    return (
      <>
        <h1 className="footer fixed-down">
          {" "}
          <h3
            style={{
              marginLeft: `10%`,
              fontSize: `40px`,
              fontWeight: `bolder`,
              fontStyle: `italic`,
              color: "white",
            }}
          >
            Blue
            <span style={{ color: `orange`, fontFamily: `sans-serif` }}>
              Let
            </span>
          </h3>
        </h1>
      </>
    );
  }
}

export default Footer;
